import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src='https://lh6.googleusercontent.com/HClfAEF5_jjXpArTaMa6xdp-dp5BYCQ_MkEiI2F85ZInWX5aE-D5-Tl2xDrL96N5RBEzkWArgZpWDLuB30z5SjXri3sJFzzATSR3YG3_TXX7OEQCAbtnY3v-3-NlkSvJnc8iuS2xCOo' className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
